import React from 'react'

const HeroMain = () => {
  return (
    <div className='relative'>
      <h1 className='text-[15em] text-green-600 tracking-tighter bg-transparent'>Kode!</h1>
      <div className='w-[6em] h-[6em] bg-green-400 rounded-full absolute top-40 left-[10em] z-10'/>
      <div className='w-[8em] h-[8em] border-4 border-gray-600 rounded-full absolute top-[10em] left-[10em] z-10'/>
    </div>
  )
}

export default HeroMain
